import './App.css';
import { dividerClasses } from '@mui/material';
import NavBar from './project/NavBar';
import Home from './project/Home';
import About from './project/About';
import LogIn from './project/LogIn';
import SingUp from './project/SingUp';
import {UsersProvider, BrowserRouter, Route, Routes } from 'react-router-dom'
import AddRecipeForm from './project/AddRecipeForm';
i



function App() {
  return (

    <div>


          <BrowserRouter>
          <NavBar/>
            <Routes>
              <Route path='/' element={<AddRecipeMeneger />} />
              <Route path='/login' element={<LogIn />} />
              <Route path='/home' element={<Home />} />
              <Route path='/singup' element={<SingUp />} />
              <Route path='/about' element={<About />} />

            </Routes>
          </BrowserRouter>

    </div>

  );
}

export default App;
